script: |
  super -f text -I q1865.spq | sort > q1865.out

inputs:
  - name: q1865.spq
    data: |
      SELECT DISTINCT + ( 53 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor2, tab2 (FORMAT parquet);
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1865.out
    data: |
      53
